import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import Login from './components/Login';

const App = () => {
  const [spotifyToken, setSpotifyToken] = useState(null);
  const [youtubeToken, setYoutubeToken] = useState(null);

  useEffect(() => {
    const params = new URLSearchParams(window.location.search);
    const spotifyAccessToken = params.get('spotify_access_token');
    const youtubeAccessToken = params.get('youtube_access_token');

    if (spotifyAccessToken) {
      setSpotifyToken(spotifyAccessToken);
    }
    if (youtubeAccessToken) {
      setYoutubeToken(youtubeAccessToken);
    }
  }, []);

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Dashboard spotifyToken={spotifyToken} youtubeToken={youtubeToken} />} />
        <Route path="/login" element={<Login />} />
      </Routes>
    </Router>
  );
};

export default App;
